        [Test]
        [TestCase(16, "bcfd113bb8c4ca26f55099a1109c1d1bca353e325b421bd409c144a4f8132a9f", "de19")]
        [TestCase(1549, "f768051131356da741cc92bfafa9cfd15d2ec981b23eafd1f807c096031f0e29", "")]
        [TestCase(8119, "3f3c0ee856492814a719b4bd0247af81dd80e28ff994ac5f43cc01a1f97fb373", "")]
        [TestCase(65497, "692e0ed191acf9298420f46d4f34943738ea64304ede207945cc2449815123d7", "")]
        public void ShouldActAsSHAKE256HashCorrectlyWithVariableOutput(int outputLength, string inputHex, string outputHex)
        {
            var message = new BitString(inputHex);
            var expectedResult = new BitString(outputHex, outputLength, false);
            var hashFunction = GetCSHAKEHashFunction(outputLength, 512);

            var subject = new CSHAKE();
            var result = subject.HashMessage(hashFunction, message);

            Assume.That(result.Success);
            Assert.AreEqual(expectedResult, result.Digest);
        }

        private HashFunction GetCSHAKEHashFunction(int digestSize, int capacity)
        {
            return new HashFunction()
            {
                DigestSize = digestSize,
                Capacity = capacity,
                XOF = true
            };
        }
